  (d.rows || []).forEach(row => {
    const tr = document.createElement('tr');
    const pcell = document.createElement('td'); pcell.textContent = row.img_pos; tr.appendChild(pcell);
    (row.layer_top1_detok || []).forEach((dtx, idx) => {
      const td = document.createElement('td'); td.className='cell';
      td.textContent = dtx;
      const klist = (row.layer_topk && row.layer_topk[idx]) || [];
      td.title = klist.map(o => `${o.detok}  [${o.piece}]  p=${(o.prob||0).toFixed(4)}`).join('\n');
      tr.appendChild(td);
    });
    tbody.appendChild(tr);
  });
  table.appendChild(tbody); grid.appendChild(table);

  const wrap = document.createElement('div'); wrap.className='wrap';
  wrap.appendChild(left); wrap.appendChild(grid);
  root.innerHTML = ''; root.appendChild(wrap);
})(DATA);
</script>
</body>
</html>
